// App.js
import React from 'react';
import './App.css';
import DataTable from './DataTable';
import MusicVisualizerContainer from './MusicVisualizerContainer'; // Use the container

import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import MainPage from './MainPage';

function App() {
  return (
    <Router>
      <div className="app">
        <Routes>
          <Route path="/main_page" element={<MainPage />} />
          <Route path="/data_table" element={<DataTable />} />
          <Route path="/music_visualizer" element={<MusicVisualizerContainer />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
